member.example:
This snippet shows how to add a file logger using the ApiLogManager class:
apiContext.ApiLogManager = new ApiLogManager();
apiContext.ApiLogManager.ApiLoggerList.Add(new FileLogger("listing_log.txt", true, true, true));
apiContext.ApiLogManager.EnableLogging = true;

This snippet shows how to add a file logger using the ApiLogManager class, with everything logged,
error messages, exceptions, and informational messages:

apiContext.ApiLogManager = new ApiLogManager();
apiContext.ApiLogManager.ApiLoggerList.Add(new FileLogger("listing_log.txt", true, true, true));
apiContext.ApiLogManager.EnableLogging = true;

 The following snippet shows how to set up the use of the CallMetricsEntry:

GetUserCall apiCall = new GetUserCall(apiContext);
apiCall.CallMetricsEntry = new CallMetricsEntry();
apiCall.DetailLevelList.Add(DetailLevelCodeType.ReturnAll);
apiCall.Execute();
piLogger MyLog = new FileLogger("entry_log.txt", true, true, true);
apiCall.CallMetricsEntry.GenerateReport(MyLog);
